import Firebase from "./src/firebase";
import Authentication from "./src/pages/Authentication";

import Home from "./src/pages/Home";


const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
    <StackNavigator/>
    </NavigationContainer>
